  const canvas = useRef(null)
  useEffect(function () {
    let c = canvas.current
    Fluid(c)
  }, [])
  return (
    <div className="App">
      <canvas ref={canvas} style={{
  position: "fixed",
  top: "0",
  left: "0",
  height: "100%",
  width: "100%"
}}

      ></canvas>
      {/* <h1 style={{{ color: 'red'>Narayan Sharma</h1> */}
      <Home />
    </div>
  );
}
